import React, { useEffect, useState } from "react";
import { Magic } from "magic-sdk";
import { ethers } from "ethers";
import MIGRANT_ID_ABI from "./contracts/MigrantID.json";

const magic = new Magic("pk_live_845610B169B276D7"); // Replace with your pk_test or pk_live
const CONTRACT_ADDRESS = "0x37657A4D05AEc89d0bC1C17f126a8bB89D014a4b";

function MagicLogin() {
  const [email, setEmail] = useState("");
  const [user, setUser] = useState(null);
  const [name, setName] = useState("");
  const [file, setFile] = useState(null);
  const [contract, setContract] = useState(null);

  useEffect(() => {
    (async () => {
      const isLoggedIn = await magic.user.isLoggedIn();
      if (isLoggedIn) {
        const metadata = await magic.user.getInfo();
        setUser(metadata);
        await initContract();
      }
    })();
  }, []);

  const initContract = async () => {
    try {
      const provider = new ethers.providers.Web3Provider(magic.rpcProvider);
      const signer = provider.getSigner();
      const network = await provider.getNetwork();
      console.log("‚úÖ Connected to:", network.name);

      const migrantContract = new ethers.Contract(CONTRACT_ADDRESS, MIGRANT_ID_ABI.abi, signer);
      setContract(migrantContract);
    } catch (err) {
      console.error("‚ùå Failed to connect to contract:", err);
    }
  };

  const handleLogin = async () => {
    try {
      await magic.auth.loginWithEmailOTP({ email });
      const metadata = await magic.user.getInfo();
      setUser(metadata);
      await initContract();
    } catch (err) {
      console.error("‚ùå Login failed:", err);
      alert("Login failed. Check the console for more info.");
    }
  };

  const handleLogout = async () => {
    await magic.user.logout();
    setUser(null);
    setEmail("");
    setName("");
    setFile(null);
    setContract(null);
  };

  const uploadToBackend = async () => {
    const formData = new FormData();
    formData.append("file", file);

    try {
      const response = await fetch("http://localhost:5001/upload", {
        method: "POST",
        body: formData,
      });

      const result = await response.json();
      if (!response.ok) throw new Error(result.error || "Upload failed");
      console.log("üì¶ Uploaded to IPFS:", result.ipfsHash);
      return result.ipfsHash;
    } catch (err) {
      console.error("‚ùå Upload error:", err);
      alert("Failed to upload file. Try again.");
      return null;
    }
  };

  const handleRegister = async () => {
    if (!name.trim() || !file || !contract) {
      alert("‚ö†Ô∏è Please enter a name and upload a file.");
      return;
    }

    const ipfsHash = await uploadToBackend();
    if (!ipfsHash) return;

    try {
      const tx = await contract.createIdentity(name, ipfsHash);
      await tx.wait();
      alert("‚úÖ Identity successfully registered on-chain!");
    } catch (err) {
      console.error("‚ùå Contract interaction failed:", err);
      alert("Something went wrong while registering identity.");
    }
  };

  // UI Rendering
  if (user) {
    return (
      <div style={{ padding: "20px" }}>
        <h3>Welcome, {user.email}</h3>
        <p><strong>Wallet Address:</strong> {user.publicAddress}</p>

        <input
          type="text"
          placeholder="Enter your name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        /><br /><br />

        <input
          type="file"
          onChange={(e) => setFile(e.target.files[0])}
        /><br /><br />

        <button onClick={handleRegister}>Register Identity</button>
        <button onClick={handleLogout} style={{ marginLeft: "10px" }}>
          Logout
        </button>
      </div>
    );
  }

  return (
    <div style={{ padding: "20px" }}>
      <h3>Login to Register Identity</h3>
      <input
        type="email"
        placeholder="Enter email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
      /><br /><br />
      <button onClick={handleLogin}>Login with Magic Link</button>
    </div>
  );
}

export default MagicLogin;
